import React from 'react'
import {Box,Stack,Typography} from'@mui/material';

const HeroBanner = () => {
  return (
    <div>
      <Box sx={{
        mt:{lg:'212px',xs:'70px'},
        ml:{sm:'50px'}
      }}position ="relative ">
        <Typography color="#FF2625"
        fontweight="600" fontSize="26px">
          Fitness Club
        </Typography>
      </Box>
    </div>
  )
}

export default HeroBanner
